import React from 'react';
import { useEffect } from 'react';
import axios from 'axios'
export default function App() {
  useEffect(()=>{
    axios.get('https://jsonplaceholder.typicode.com/users').then(
    (res)=>{ console.log(res.data)}
    )
    },[]
)
  return (
    <div>App</div>
  )
}
